"208230":{"id":"208230","name":"Ilhas Selvagens","slug":"ilhas-selvagens","original_title":"Wild Isles","overview":"Nesta série de cinco episódios, David Attenborough revela a vida selvagem e espetáculos naturais tão exóticos e espetaculares como todos os que ele já viu pelo mundo. De baleias assassinas e grandes revoadas de aves limícolas à vida íntima da borboleta-azul, narrativas valiosas de história natural revelam a importância da vida selvagem britânica, mas também reconhecem o desafio de protegê-las.","first_air_date":"2023-03-12","episode_run_time":0,"vote_average":8.3,"number_of_seasons":1,"number_of_episodes":5,"created_by":[],"production_companies":["Silverback Films","RSPB","WWF-UK"],"genres":["Documentário"],"certification":"N/A","backdrop_path":"https://image.tmdb.org/t/p/original/dpJ2wnj7uU4EuvWICR1z48W5PH6.jpg","poster_path":"https://image.tmdb.org/t/p/original/yiSwORY2qJeNOOA7I6fcMccKRLH.jpg","cast":["David Attenborough"],"trailer":"N/A","seasons":{"0":{"name":"Especiais","poster_path":"https://image.tmdb.org/t/p/original/qs3mIfQIFjp1JeqzWg8G1jScd1C.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/qs3mIfQIFjp1JeqzWg8G1jScd1C.jpg","air_date":"2023-04-09","episode_count":1,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Episódio 1","overview":"N/A","air_date":"2023-04-09","runtime":54,"still_path":"https://image.tmdb.org/t/p/original/1LkM2TKbBHywUw8lgmyrgy6ca1.jpg","vote_average":0}}},"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/2IQm2H0D9rkJCziGZrEcPROWUhI.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/2IQm2H0D9rkJCziGZrEcPROWUhI.jpg","air_date":"2023-03-12","episode_count":5,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Nossas Ilhas Preciosas","overview":"David Attenborough celebra a vida selvagem britânica, tão dramática e espetacular como a que ele viu pelo mundo, e revela por que ela é globalmente importante. Ela abriga orcas, águias-reais, carvalhos antigos e vastas florestas de campânulas. Mas, apesar de rica em alguns lugares, a Grã-Bretanha é um dos locais com a natureza mais depredada do mundo. É hora de restaurá-la para gerações futuras.","air_date":"2023-03-12","runtime":58,"still_path":"https://image.tmdb.org/t/p/original/kwtjKCqoAsul13DEct2zRMlnpqo.jpg","vote_average":0},"2":{"name":"Florestas","overview":"David Attenborough acompanha as florestas britânicas por um ano, mostrando sua surpreendente variedade e revelando histórias incríveis nas florestas. De águias-reais a reprodução de lesmas, de esquilos acrobáticos a lutas entre gamos, as florestas britânicas são repletas de dramas ocultos, espetáculos impressionantes e muitas surpresas... todas escondidas em meio às árvores.","air_date":"2023-03-19","runtime":58,"still_path":"https://image.tmdb.org/t/p/original/j27WktY34YP9KRVPNNt8kmBMLKc.jpg","vote_average":0},"3":{"name":"Pradarias","overview":"David Attenborough explora alguns dos lugares mais belos da Inglaterra e Irlanda, nossas pradarias, e revela como elas funcionam, as criaturas que as criam e as histórias extraordinárias que escondem. De campinas de flores costeiras nas Hébridas Exteriores da Escócia a ricas paisagens montanhosas no Sul da Irlanda, penetramos em mundos surpreendentes e dramáticos.","air_date":"2023-03-26","runtime":59,"still_path":"https://image.tmdb.org/t/p/original/v7dpAgrR8NrZzjIWH78BlIcq5bK.jpg","vote_average":0},"4":{"name":"Água Doce","overview":"Dos córregos nas terras altas às planícies de lama, David Attenborough nos leva das nascentes ao mar, seguindo os cursos de água doce britânicos. No caminho, encontramos uma gama de vida selvagem que vive dentro e ao redor dos rios e lagos britânicos. Se salmões saltadores a castores construtores de represas, de efêmeras a morcegos, o drama e o espetáculo nunca estão longe desse mundo aquático.","air_date":"2023-04-02","runtime":60,"still_path":"https://image.tmdb.org/t/p/original/prVasyTNRleafyj67soS0qYtUEf.jpg","vote_average":0},"5":{"name":"Oceano","overview":"David Attenborough explora os mares britânicos, desde águas rasas ao abundante mar aberto, e revela histórias extraordinárias da vida selvagem. Em nossas praias, milhares de focas se reproduzem. Sob as ondas, cavalos-marinhos cortejam delicadamente, exércitos de caranguejos marcham e lesmas marinhas dançam como fadas. Nunca entediantes, os mares da Grã-Bretanha são cheios de mistérios e surpresas.","air_date":"2023-04-09","runtime":58,"still_path":"https://image.tmdb.org/t/p/original/sQSDWhNVLUDEOzilXQoKAnQxdkv.jpg","vote_average":0}}}}},
